import React, { useState, useEffect } from "react";
import { getCrashes } from "./api";

export default function CrashList() {
    const [values, setValues] = useState({
        crashList: [],
    });

    const init = () => {
        getCrashes().then(data => {
            if (data.error) {
                setValues({ ...values, error: data.error });
            } else {
                setValues({
                    ...values,
                    crashList: data
                });
            }
        });
    };

    useEffect(() => {
        init();
    }, []);

    return (
        <div>
            hi
            {crashList}
        </div>
    );
};
